import React, { Component } from "react";

class myButton extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div>
        <button className="p-3 rounded-full border-2 border-red-500 bg-white-50">
          {this.props.title}
        </button>
      </div>
    );
  }
}

export default myButton;
